import React from "react";
import Transaction from "../Transaction";
import { Button } from "react-bootstrap";
import MoneyCard from "../Cards/MoneyCard";

const TransactionPage = () => {
  return (
    <div className="d-flex justify-content-center">
      <div className="row px-0" style={{ width: "95%", backgroundColor: "" }}>
        <div
          className="mx-0 row col-lg-9 col-md-12 col-sm-12"
          style={{ backgroundColor: "" }}
        >
          <Transaction />
        </div>
        <div className="mx-0 col-lg-3" style={{ backgroundColor: "" }}>
          <div className="my-5">
            <div
              className="row mt-2 mb-5 col-lg-12 col-md-3 col-sm-5 d-flex justify-content-center"
              style={{ backgroundColor: "" }}
            >
              <Button size="lg" variant="outline-secondary">
                Add Goal
              </Button>
            </div>
            <div className="my-2 ">
              <MoneyCard amount={"$850.00"} title={"MacBook Air"} />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default TransactionPage;
